#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    int numMatchingSubseq(string S, vector<string>& words) {
        int ans = 0;
        /*
        cout << S << endl;
        for(int i = 0; i < words.size(); i ++){
            cout << words[i] << endl;
        }
        */
        vector< vector<int> > a_z_i(26);
        for(int i = 0; i < S.size(); i++){
            uint8_t c = S[i]-'a';
            a_z_i[c].push_back(i);
        }
        /*
        for(int i = 0; i < a_z_i.size(); i ++){
            char a = 'a'+i;
            cout << a ;
            for(int j = 0; j < a_z_i[i].size(); j++){
                cout << " " << a_z_i[i][j];
            }
            cout << endl;
        }
        */
        for(int i = 0; i < words.size(); i++){
            int32_t cur_s = -1, cur_w = 0;
            bool is_inorder = (words[i].size() < S.size());

            for(; cur_w < words[i].size() && is_inorder; cur_w++){
                uint8_t c = words[i][cur_w]-'a';
                int32_t e = a_z_i[c].size()-1;
                bool is_found = false;

                for(int k = 0; k <= e && !is_found; k++){
                    if(a_z_i[c][k] > cur_s){
                        cur_s = a_z_i[c][k];
                        is_found = true;
                    }
                }
                is_inorder &= is_found;

            }
            if(is_inorder && cur_w == words[i].size()){
                ans++;
            }
        }
        return ans;
    }
};

